import React from "react";
import  "./Navbar.css"
import logo from "./Assets/icon.png"

const Navbar = () => {
    return (
        <div>
            <nav className="navbar "></nav>
            <a className="navbarlogo" ><img src={logo} width={300}  /></a>

        </div>
    )

}
export default Navbar
